INSERT INTO `tb_task` (`task_id`, `deadline`, `task_desc`, `task_name`, `segment_id`) VALUES
	(1, '2023-08-10 13:20:00.000000', '<ol dir="auto" style="padding-left: 2em; margin-bottom: 16px; color: rgb(230, 237, 243); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, &quot;Noto Sans&quot;, Helvetica, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;; background-color: rgb(13, 17, 23);"><li><p dir="auto" style="margin-top: 16px; margin-bottom: 16px;">Rumuskan&nbsp;<em>single query</em>&nbsp;untuk menampilkan jumlah&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">total customer</span>&nbsp;yang Anda layani, beserta jumlah&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">total kota &amp; negara asal</span>&nbsp;customer-customer Anda. Contoh output yang diharapkan:</p><div class="highlight highlight-source-shell notranslate position-relative overflow-auto" dir="auto" style="margin-bottom: 16px;"><pre style="font-family: ui-monospace, SFMono-Regular, &quot;SF Mono&quot;, Menlo, Consolas, &quot;Liberation Mono&quot;, monospace; font-size: 13.6px; margin-bottom: 0px; overflow-wrap: normal; padding: 16px; line-height: 1.45; color: var(--fgColor-default, var(--color-fg-default)); background-color: var(--bgColor-muted, var(--color-canvas-subtle)); border-radius: 6px; word-break: normal;">+-----------+--------+-----------+\n<span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Customers <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Cities <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Countries <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>\n+-----------+--------+-----------+\n<span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>       122 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>     95 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>        27 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>\n+-----------+--------+-----------+</pre></div><p dir="auto" style="margin-top: 16px; margin-bottom: 16px;">Anda memiliki&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">122 customer</span>&nbsp;dari&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">95 kota</span>&nbsp;yang tersebar di&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">27 negara</span>!</p></li><li style="margin-top: 0.25em;"><p dir="auto" style="margin-top: 16px; margin-bottom: 16px;">Rumuskan&nbsp;<em>single query</em>&nbsp;untuk menampilkan&nbsp;<em>resources</em>&nbsp;yang Anda miliki, mulai dari jumlah&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">karyawan</span>, jumlah&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">kantor &amp; lokasi negaranya</span>, jumlah&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">barang yang dijual</span>, total&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">stok barang</span>&nbsp;&amp; jumlah&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">vendor</span>&nbsp;yang menjadi partner Anda. Contoh output yang diharapkan:</p><div class="highlight highlight-source-shell notranslate position-relative overflow-auto" dir="auto" style="margin-bottom: 16px;"><pre style="font-family: ui-monospace, SFMono-Regular, &quot;SF Mono&quot;, Menlo, Consolas, &quot;Liberation Mono&quot;, monospace; font-size: 13.6px; margin-bottom: 0px; overflow-wrap: normal; padding: 16px; line-height: 1.45; color: var(--fgColor-default, var(--color-fg-default)); background-color: var(--bgColor-muted, var(--color-canvas-subtle)); border-radius: 6px; word-break: normal;">+-----------+---------+---------+----------+---------------+---------+\n<span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Employees <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Offices <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Country <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Products <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> StockProducts <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span> Vendors <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>\n+-----------+---------+---------+----------+---------------+---------+\n<span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>        23 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>       7 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>       5 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>      110 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>        555131 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>      13 <span class="pl-k" style="color: var(--color-prettylights-syntax-keyword);">|</span>\n+-----------+---------+---------+----------+---------------+---------+</pre></div><p dir="auto" style="margin-top: 16px; margin-bottom: 16px;">Anda memiliki&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">23 karyawan</span>&nbsp;di&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">7 kantor</span>&nbsp;yang berada di&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">5 negara</span>, dengan&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">110 model die cast</span>&nbsp;(total stok mencapai&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">555131 item</span>) yang didistribusikan dari&nbsp;<span style="font-weight: var(--base-text-weight-semibold, 600);">13 vendor partner</span>.</p></li></ol>', 'Tugas 1', 1);

